var firstTime = true;
var model;

function copyClick () {
   // Create new element
   var el = document.createElement('textarea');
   // Set value (string to be copied)
   el.value = document.getElementById('displayOutput').innerHTML;
   // Set non-editable to avoid focus and move outside of view
   el.setAttribute('readonly', '');
   el.style = {position: 'absolute', left: '-9999px'};
   document.body.appendChild(el);
   // Select text inside element
   el.select();
   // Copy text to clipboard
   document.execCommand('copy');
   // Remove temporary element
   document.body.removeChild(el);
}

function deleteClick() {
    document.getElementById('aaInput').value = '';
}

function predictClick() {
    var sequence = document.getElementById('aaInput').value;
    result = checkValidity(sequence);
    if (result == null) {
        document.getElementById('errorMsg').style.display = 'block';
    }
    else {
        var new_break1 = "";
        var i = 0;
        result = result.toUpperCase();
        for (var v = 0; v < result.length; v++) {
            new_break1 += result[v];
            i++;
            if (i == 5) {i = 0; new_break1 += " "; }
        }
        result = formatInput(result);
        if (firstTime) {
            firstTime = false;
            model = tf.loadLayersModel('new_model.json/model.json').then(loaded => {
                var prediction = loaded.predict(result);
                formatOutput(prediction).then (predicted => {
                    predicted = predicted.toUpperCase();
                    draw(predicted);
                    var new_break2 = "";
                    var i = 0;
                    for (var v = 0; v < predicted.length; v++) {
                        new_break2 += predicted[v];
                        i++;
                        if (i == 5) {i = 0; new_break2 += " "; }
                    }
                    document.getElementById('displayInput').innerHTML = new_break1;
                    document.getElementById('displayOutput').innerHTML = new_break2;
                    document.getElementById('dsspOutput').style.display = 'block';
                });
                return loaded;
            });
        }
        else {
            model.then (loaded => {
                prediction = loaded.predict(result);
                formatOutput(prediction).then (predicted => {
                    predicted = predicted.toUpperCase();
                    draw(predicted);
                    var new_break2 = "";
                    var i = 0;
                    for (var v = 0; v < predicted.length; v++) {
                        new_break2 += predicted[v];
                        i++;
                        if (i == 5) {i = 0; new_break2 += " "; }
                    }
                    document.getElementById('displayInput').innerHTML = new_break1;
                    document.getElementById('displayOutput').innerHTML = new_break2;
                    document.getElementById('dsspOutput').style.display = 'block';
                });
            });
        }
    }
}

function draw(seqs) {
    var img = document.getElementById("img");
    var c = document.getElementById("C");
    var e = document.getElementById("E");
    var h = document.getElementById("H");
    var ctx = img.getContext("2d");
    var curr_x = 0;
    var curr_y = 0;
    ctx.clearRect(0, 0, img.width, img.height);
    for (var v = 0; v < seqs.length; v++) {
        if ((v!=0)&&(v%28 == 0)) {curr_x = 0; curr_y += 20;}
        if (seqs[v] == 'C') {
            ctx.drawImage(c, curr_x, curr_y, 20, 20);
            curr_x += 20;
        }
        if (seqs[v] == 'E') {
            ctx.drawImage(e, curr_x, curr_y, 20, 20);
            curr_x += 20;
        }
        if (seqs[v] == 'H') {
            ctx.drawImage(h, curr_x, curr_y, 20, 20);
            curr_x += 20;
        }
    }
}

function checkValidity(seqs) {
    seqs = seqs.replace(/\s+/g, '');
    if (seqs.length < 3) {
        return null
    }
    if (seqs.length >= 256) {
        seq_len = 256;
    }
    else {
        seq_len = seqs.length;
    }
    new_seqs = "";
    for (var v = 0; v < seq_len; v++) {
        if (seqs[v] == '*'||seqs[v] == 'g'||seqs[v] == 'G'||seqs[v] == 'a'||seqs[v] == 'A'||seqs[v] == 'l'||seqs[v] == 'L'||seqs[v] == 'm'||seqs[v] == 'M'||seqs[v] == 'f'||seqs[v] == 'F'||seqs[v] == 'w'||seqs[v] == 'W'||seqs[v] == 'k'||seqs[v] == 'K'||seqs[v] == 'q'||seqs[v] == 'Q'||seqs[v] == 'e'||seqs[v] == 'E'||seqs[v] == 's'||seqs[v] == 'S'||seqs[v] == 'p'||seqs[v] == 'P'||seqs[v] == 'v'||seqs[v] == 'V'||seqs[v] == 'i'||seqs[v] == 'I'||seqs[v] == 'c'||seqs[v] == 'C'||seqs[v] == 'y'||seqs[v] == 'Y'||seqs[v] == 'r'||seqs[v] == 'R'||seqs[v] == 'd'||seqs[v] == 'D'||seqs[v] == 'h'||seqs[v] == 'H'||seqs[v] == 't'||seqs[v] == 'T'||seqs[v] == 'n'||seqs[v] == 'N'){
            new_seqs += seqs[v].toLowerCase();
        }
        else {
            if (seqs[v] == 'b'||seqs[v] == 'B'||seqs[v] == 'o'||seqs[v] == 'O'||seqs[v] == 'u'||seqs[v] == 'U'||seqs[v] == 'x'||seqs[v] == 'X'||seqs[v] == 'z'||seqs[v] == 'Z') {
                new_seqs += '*';
            }
            else {
                return null;
            }
        }
    }
    return new_seqs;
}

